import React from 'react';

interface Price {
  ingredient: string;
  price: number;
  store: string;
}

interface PriceTableProps {
  prices: Price[];
  isLoading: boolean;
}

const PriceTable: React.FC<PriceTableProps> = ({ prices, isLoading }) => {
  const total = prices.reduce((sum, item) => sum + item.price, 0);

  if (isLoading) {
    return <div className="text-center">Loading prices...</div>;
  }

  return (
    <div className="mt-6">
      <h2 className="text-xl font-semibold mb-4">Cost Estimation</h2>
      <div className="overflow-x-auto">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Ingredient
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Price
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Store
              </th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {prices.map((item, index) => (
              <tr key={index}>
                <td className="px-6 py-4 whitespace-nowrap">{item.ingredient}</td>
                <td className="px-6 py-4 whitespace-nowrap">${item.price.toFixed(2)}</td>
                <td className="px-6 py-4 whitespace-nowrap">{item.store}</td>
              </tr>
            ))}
            <tr className="bg-gray-50">
              <td className="px-6 py-4 font-medium">Total</td>
              <td className="px-6 py-4 font-medium">${total.toFixed(2)}</td>
              <td></td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default PriceTable;
